body {
  font-family: "Merriweather", serif;
  /* font-family: "proxima-nova", sans-serif; */
  background: #d4d8f0;
  /* #efe8fa */
  color: #1f1235;
}

#top-banner {
  width: 100%;
  border-radius: 10px;
  padding-top: 10px;
  padding-bottom: 10px;
  background: #232946;
}

#company-name {
  display:inline;
  position: relative;
  font-size: 70px;
  font-family: "Space Grotesk", sans-serif;
  margin: 0;
  color: #fffffe;
  text-decoration: underline;

}

#sign-up {
  width: 12%;
  height: 6vh;
  border-radius: 10px;
  float: right;
  border: 1px solid black;

  font-size: 15px;
  margin-right: 40px;
  margin-top: 20px;

  background: #b8c1ec;
  /* color: #232946; */
  cursor: pointer;

  box-shadow: 4px 4px black;
}


#contact-provider {
  width: 12%;
  height: 6vh;
  float: left;
  border: 1px solid black;
  font-size: 15px;

  margin-left: 40px;
  margin-top: 20px;

  background: #eebbc3;
  box-shadow: 4px 4px black;
  border-radius: 10px;

}

/* /////////////////////
        MAIN
///////////////////// */

#main #header {
  font-size: 45px;
  margin-left: 10%;
  margin-top: 7vh;
  width: 90%;
  color: #232946;
}

#main #input {
  width: 55%;
  background: #fffffe;
  height: 50vh;
  float: right;
  margin-right: 100px;
  position: relative;
  top: 3vh;

  border-radius: 35px;
  border: 3px solid #ffc354;
  box-shadow: 15px 15px #b8c1ec;
}

#main input {
  width: 80%;
  position: relative;
  top: 8vh;
  margin-bottom: 4vh;
  height: 35px;
  border-radius: 3px;
  border: 2px solid #232946;
  padding-left: 10px;
  font-size: 16px;
}

#main #search {
  position: relative;
  top: 15vh;
  width: 82%;
  height: 40px;
  border-radius: 3px;
  border: 2px solid black;
  cursor: pointer;

  background: #5fb4b7;
  color: #153031;
  font-size: 17px;
  transition: all 1s ease-in-out;
  font-family: "Space Grotesk", sans-serif;
}

#main #search:hover {
  border: 3px dotted black;
  transition: all 0.5s ease-in-out;
}

/* /////////////////////
        RESULTS
///////////////////// */

#results {
}

#results #input {
  float: left;
  margin: 35px;
  width: 50%;
}

#results input {
  height: 40px;
  width: 30%;
  padding-left: 20px;
  border: 2px solid black;
  font-size: 16px;
}

#results #search {
  width: 70%;
  float: left;
  position: relative;
  height: 40px;
  border-radius: 3px;
  border: 2px solid black;
  margin-top: 15px;
  cursor: pointer;

  background: #5fb4b7;
  color: #153031;
  font-size: 17px;
  transition: all 1s ease-in-out;
  font-family: "Space Grotesk", sans-serif;
}

#results #filters {
  border: 1px solid black;
  width: 35%;
  height: 55vh;
  margin-left: 35px;

  position: relative;
  top: 23vh;
}

/* Dropdown Button */
.dropbtn {
 background-color: #04AA6D;
 color: white;
 padding: 16px;
 font-size: 16px;
 border: none;
 cursor: pointer;
}

/* Dropdown button on hover & focus */
.dropbtn:hover, .dropbtn:focus {
 background-color: #3e8e41;
}

/* The search field */
#myInput {
 box-sizing: border-box;
 background-position: 14px 12px;
 background-repeat: no-repeat;
 font-size: 16px;
 padding: 14px 20px 12px 45px;
 border: none;
 border-bottom: 1px solid #ddd;
}

/* The search field when it gets focus/clicked on */
#myInput:focus {
  outline: 3px solid #ddd;
}

/* The container <div> - needed to position the dropdown content */
.dropdown {
 position: relative;
 display: inline-block;
}

/* Dropdown Content (Hidden by Default) */
.dropdown-content {
 display: none;
 position: absolute;
 background-color: #f6f6f6;
 min-width: 230px;
 border: 1px solid #ddd;
 z-index: 1;
}

/* Links inside the dropdown */
.dropdown-content a {
 color: black;
 padding: 12px 16px;
 text-decoration: none;
 display: block;
}

/* Change color of dropdown links on hover */
.dropdown-content a:hover {background-color: #f1f1f1}

/* Show the dropdown menu (use JS to add this class to the .dropdown-content container when the user clicks on the dropdown button) */
.show {display:block;}

#results #plan {
  position: relative;
}

#results #data {
  width: 60%;
  height: 80vh;
  top: 20%;
  right: 15px;
  position: absolute;

  float: right;
}

#results #data-header {
  font-size: 45px;
  position: relative;

}

#results #data {
  margin-top: 20px;
  overflow: auto;
}

.card {
    border: 3px solid black;
    margin-bottom: 20px;
    border-radius: 10px;
    width: 75%; /* Adjust as needed */
    margin-top: 10px;
}

.header {
    display: flex;
    border-top-left-radius: 10px;
    border-top-right-radius: 10px;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 20px;
    background: #fffffe;
    padding: 15px;
}

.price-info {
    text-align: right;
}

.hospital-name {
    font-size: 18px;
    font-weight: bold;
}

.cash-price,
.your-price {
    display: block;
    color: #333;
}

.your-price {
    color: green;
    font-weight: bold;
}

.service-info {
    margin-bottom: 20px;
}

.service-title {
    font-size: 16px;
    font-weight: bold;
    margin: 0 0 10px 0;
}

.service-address {
    margin: 0;
    color: #666;
}

.distance {
    display: block;
    color: #333;
    margin-top: 5px;
    float: right;
    margin-right: 10px;
}

.appointment-btn {
    background-color: #eebbc3;
    color: black;
    border: none;
    padding: 10px 20px;
    text-align: center;
    text-decoration: none;
    display: inline-block;
    font-size: 16px;
    margin-right: 35%;
    margin-bottom: 30px;
    cursor: pointer;
    border-radius: 4px;
}
